    private List<String> getErrorPhonesFull(String[] phonesArrays) {
        List<String> phonesList = Arrays.asList(phonesArrays);
        List<CompletableFuture<String>> resultFutures = StreamUtils.convert(phonesList,
                phones -> CompletableFuture.supplyAsync(
                        () -> {
                            String[] phonesArray = phones.split(",");
                            return getErrorPhones(phonesArray);
                        },
                        ExecutorConstant.OUTER_NET_IO_EXECUTOR
                )
        );
        CompletableFuture<List<String>> resultsFuture = FutureUtils.sequence(resultFutures);
        List<String> results = FutureUtils.getResultWithDrownException(
                resultsFuture,
                e -> System.out.println(e.getLocalizedMessage())
        );
        return results;
    }

    private String getErrorPhones(String[] phones) {
        List<String> errorPhones = new ArrayList<>();
        for (String phone : phones) {
            String result = getDevices(phone);
            if (StrUtil.isNotEmpty(result)) {
                errorPhones.add(result);
            }
        }
        return String.join(StrUtil.CR, errorPhones);
    }

    private String getDevices(String phone) {
        AliasDeviceListResult result;
        try {
            result = jpushClient.getAliasDeviceList(phone, null);
        } catch (APIConnectionException e) {
            System.out.println(phone + " 查询失败");
            return StrUtil.EMPTY;
        } catch (APIRequestException e) {
            System.out.println(phone + " 查询失败");
            return StrUtil.EMPTY;
        }
        if (!result.isResultOK()) {
            System.out.println(phone + " 查询failed，" + JSONUtil.toJsonStr(result));
            return StrUtil.EMPTY;
        }
        if (CollectionUtils.isEmpty(result.registration_ids) || result.registration_ids.size() == 1) {
            return StrUtil.EMPTY;
        }
        return phone + "@@" + JSONUtil.toJsonStr(result.registration_ids);
    }

